import React from "react";

//Styles
import style from '../styles/mainIcons.css';

//Images
import pqrs from '../images/1x/pqrsIcon.png';
import pqrs2x from '../images/2x/pqrsIcon@2x.png';
import pqrs3x from '../images/3x/pqrsIcon@3x.png';

import news from '../images/1x/newsIcon.png';
import news2x from '../images/2x/newsIcon@2x.png'
import news3x from '../images/3x/newsIcon@3x.png';


import developments from '../images/1x/developmentIcon.png';
import developments2x from '../images/2x/developmentIcon@2x.png';
import developments3x from '../images/3x/developmentIcon@3x.png';


function MainIcons(){
    return(
        <div className="main-icons-container">
        
            <div  className="pqrs-container">

                <img className="textImage-1" srcSet={`${pqrs} 1x, ${pqrs2x} 2x, ${pqrs3x} 3x`} src={pqrs} alt="pqrsIcon"/>

            </div>

            <div className="news-container">

                <img className="textImage-1" srcSet={`${news} 1x, ${news2x} 2x, ${customerSupportText3x} 3x`} src={news} alt="bigSpiral"/>

            </div>

            <div className="developments-container">

                <img className="textImage-1" srcSet={`${customerSupportText} 1x, ${customerSupportText2x} 2x, ${customerSupportText3x} 3x`} src={customerSupportText} alt="bigSpiral"/>

            </div>

        </div>
    )
}

export {MainIcons};
